import React from "react";
import { Routes, Route, Link } from "react-router-dom";
import ChemistUpload from "./pages/ChemistUpload";
import DoctorCreatePrescription from "./pages/DoctorCreatePrescription";
import ChemistScan from "./pages/ChemistScan";

function App(){
  return (
    <Routes>
      <Route path="/" element={<LandingPage />} />
      <Route path="/patient-registration" element={<div>Patient Registration Page - Coming Next!</div>} />
      <Route path="/pharmacy" element={<ChemistUpload />} />
      <Route path="/doctor" element={<DoctorCreatePrescription />} />
      <Route path="/scan" element={<ChemistScan />} />
    </Routes>
  );
}

export default App;
